import * as react from 'react';
import {
  Typography,
  Stack,
  Button,
  Card,
  CardContent,
  CardHeader,
  Divider,
  Box,
  Grid,
  Paper,
} from '@mui/material';
import { useNavigate } from 'react-router-dom';

export default function Dashboard(): React.ReactElement {
  const navigate = useNavigate();
  return (
    <Box
      sx={{
        display: 'flex',
        direction: 'column',
        gap: 2,
        flex: 1,
        minHeight: 0,
        bgcolor: 'primary.main',
      }}
    >
      <Stack
        direction="row"
        alignItems="center"
        spacing={1}
        sx={{ width: '100%', bgcolor: 'background.paper' }}
      >
        <Typography variant="h6" sx={{ flex: 1 }}>
          Overview
        </Typography>
        <Button variant="contained" sx={{ boxShadow: 'none' }} onClick={() => navigate('/live')}>
          Go live
        </Button>
      </Stack>
      <Grid container spacing={2}>
        <Grid>
          <Card>
            <CardHeader>Today's Violations</CardHeader>
            <CardContent></CardContent>
          </Card>
        </Grid>
      </Grid>
    </Box>
  );
}
